Years: 2019
Genre: Mystery
Cast : Ario Bayu, Hannah AlRasyid, and Zara A
.
.
Butuh film Horror yang bikin loe terhibur? Atau dengan teror Horror yang membabi buta?em..kayaknya film ini cocok deh buat nemenin selera horor loe di tengah pandemi ini. Film ini juga merupakan duet antara sutradara timo dan Joko Anwar sehingga hasil film yang didapatkan menjadi perpaduan yang menarik.
.
.
Menceritakan tentang Hanif dan keluarga kecilnya bertandang ke rumah Bandi di tempat yang sangat terpencil dan jauh banget dari keramaian. Bandi ini adalah pria pemilik panti asuhan yang dulu berjasa mengasuh Hanif sejak masih kecil. Oleh karena Bandi sedang sakit parah, maka sebagai anak angkat, Hanif merasa perlu menengoknya dan berencana buat menginap.
.
.

Tak hanya Hanif, dua teman Hanif beserta keluarga masing-masing pun ikut mengunjungi Bandi yang dulunya sama-sama anak panti. Namun, sesampainya di sana, sesuatu telah berubah menjadi mencekam. Seluruh keluarga hampir terkena santet, bahkan sangat mengerikan. Hal ini berhubungan dengan latar belakang Bandi. Lantas, ada apakah dengan Bandi?
.
.
Guys, cerita dalam film ini memang umum, seperti cerita hantu pada biasanya. Hantu yang ditampilkan dalam film ini juga, sama aja, kalo menurut gw ga terlalu menakutkan. Namun, loe harus ngerasain terornya, Beuuh, gila si, kayak mimpi buruk aja, gw seakan dibuat ga bisa nafas, terornya bener-bener terus menerus tanpa ampun, dan hal inilah yang bikin film ini menjadi mencekam. Kalo menurut gw, film ini kebanyakan adegan ngilunya si, dan faktor takut nya ada diteror itu sendiri. Gila si.
Rating pribadi: 8/10
.
